import React, { useState } from 'react'

import Select from "react-select";
import { useForm, Controller } from "react-hook-form";
import { yupResolver } from "@hookform/resolvers/yup";
import * as yup from "yup";

import '../styles/form.css'

const options = [
  { value: "12345", label: "Nome Exemplo da fazenda" },
];

const optionsLab = [
  { value: "1234", label: "Laboratorio exemplo" },
];

const schema = yup.object().shape({
    infosPropriedade: yup
    .object()
    .shape({
      label: yup.string().required("status is required (from label)"),
      value: yup.string().required("status is required")
    })
    .nullable() 
    .required("status is required (from outter null check)")
});

export default function Form() {
  const {handleSubmit, control, register, formState: { errors } } = useForm({
    resolver: yupResolver(schema)
  });

  const onSubmit = (data) => console.log(data);

  return (
    <div className="App">
        <main>

<div className="card-post" >

    <h1>Criar postagem</h1>
    <div className="line-post" ></div>

    <div className="card-body-post" >

       
    <form onSubmit={handleSubmit(onSubmit)}>

    <div className="fields" >
                <label>Nome</label>
                <input type="text" name="title" {...register("nome")} />
                <p className="error-message">{errors.title?.message}</p>
            </div>

            <div className="fields" >
                <label>Data Inicial</label>
                <input type="date" name="title" {...register("dataIni")} />
                <p className="error-message">{errors.title?.message}</p>
            </div>

            <div className="fields" >
                <label>Data Final</label>
                <input type="date" name="title" {...register("dataFin")} />
                <p className="error-message">{errors.title?.message}</p>
            </div>

            <div className="fields" >
                <label>Info Propriedade</label>
                <Controller
          name="infosPropriedade:"
          control={control}
          render={({ field }) => (
            <Select
              {...field}
              isClearable 
              isSearchable={false}
              className="react-dropdown"
              classNamePrefix="dropdown"
              options={options}
            />
          )}
        />
            </div>
            <div className="fields" >
                <label>CNPJ</label>
                <input type="text" name="description" {...register("cnpj")} />
                <p className="error-message">{errors.description?.message}</p>
            </div>

            <div className="fields" >
                <label>Laboratório</label>
                <Controller
          name="lab"
          control={control}
          render={({ field }) => (
            <Select
              {...field}
              isClearable 
              isSearchable={false}
              className="react-dropdown"
              classNamePrefix="dropdown"
              options={optionsLab}
            />
          )}
        />
            </div>

            <div className="fields" >
                <label>Observações</label>
                <textarea type="text" name="content" {...register("observacao")} ></textarea>
                <p className="error-message">{errors.content?.message}</p>
            </div>

            <div className="btn-post" >
                <button type="submit" >Enviar</button>
            </div>

      
      </form>


    </div>

</div>

</main>


    </div>
  );
}












